    protected override async Task OnInitializedAsync()
    {
        isLoading = true;
        try
        {
            pastPapers = await Http.GetFromJsonAsync<PastPaper[]>("api/PastPapers2n3");

        }
        catch (AccessTokenNotAvailableException exception)
        {
            exception.Redirect();
